import './index.css'

const ImagePredection=()=>{
    const onAddImage=()=>{
        const uploadButton=document.getElementById('upload-button')
        const imageConatiner=document.getElementById('image-conntainer')

        const uplaodImage=document.createElement('img')
        uplaodImage.src=URL.createObjectURL(uploadButton.files[0])
        uplaodImage.style.width="100%";

        imageConatiner.innerHTML="";
        imageConatiner.appendChild(uplaodImage);
    }
    return (
        <div className='image-predection-container'>
            <div className='input-container'>
                <input className="input" id="upload-button" type='file' onChange={onAddImage}/>
            </div>
            <div id="image-container"></div>
        </div>
    )
}

export default ImagePredection;
